VALUES
  (105, 27, 'payment_terms', 'Payment Terms', 'MODERATE', 'Net 45 payment terms identified.', 'Negotiate to Net 30 standard terms.', 'open', NULL, NULL, NULL, '2026-01-19T01:20:39.713Z', '2026-01-19T01:20:39.713Z', 1, NULL, NULL, 'Payment shall be made within forty-five (45) days'),
  (106, 27, 'liquidated_damages', 'Liquidated Damages', 'HIGH', 'Uncapped liquidated damages at $5,000 per day.', 'Add cap at 10% of contract value.', 'open', NULL, NULL, NULL, '2026-01-19T01:20:39.717Z', '2026-01-19T01:20:39.717Z', 2, NULL, NULL, 'liquidated damages of Five Thousand Dollars ($5,000) per day'),
  (107, 27, 'consequential_damages', 'Consequential Damages', 'HIGH', 'No mutual waiver of consequential damages.', 'Add mutual waiver clause.', 'open', NULL, NULL, NULL, '2026-01-19T01:20:39.719Z', '2026-01-19T01:20:39.719Z', 3, NULL, NULL, 'consequential damages'),
  (108, 27, 'indemnification', 'Indemnification', 'MODERATE', 'Broad indemnification scope including owner negligence.', 'Limit indemnification to own negligence only.', 'open', NULL, NULL, NULL, '2026-01-19T01:20:39.720Z', '2026-01-19T01:20:39.720Z', 2, NULL, NULL, 'indemnify and hold harmless'),
  (109, 28, 'liquidated_damages', 'Multiple Performance-Based Liquidated Damages', 'HIGH', 'Contract includes extensive liquidated damages for HVAC energy performance ($10,000/month), medical gas uptime ($25,000/incident), air changes ($15,000/month/room), noise levels ($5,000/room), temperature control ($2,500/zone/month), and operational shutdowns ($50,000/hour)', 'Negotiate caps on liquidated damages and ensure performance criteria are achievable and measurable', 'open', NULL, NULL, NULL, '2026-01-19T01:30:45.890Z', '2026-01-19T01:30:45.890Z', 3, NULL, NULL, 'HVAC Energy Within 90% of design BTU/SF $10,000/month shortfall Medical Gas 99.99% uptime $25,000/incident Air Changes Meet or exceed code minimums $15,000/month/room Noise Levels NC-35 in patient rooms $5,000/room exceeding Temperature Control 1F of setpoint $2,500/zone/month'),
  (110, 28, 'indemnification', 'Unlimited Design Liability and Indemnification', 'HIGH', 'Trade Partner must indemnify Design-Builder and Owner for all design-related claims in excess of insurance coverage with no limitation on liability', 'Negotiate limitation of design liability to insurance coverage limits and exclude indemnification for Owner''s acts', 'open', NULL, NULL, NULL, '2026-01-19T01:30:45.894Z', '2026-01-19T01:30:45.894Z', 3, NULL, NULL, 'Trade Partner''s design liability shall not be limited by insurance coverage or any other limitation. Trade Partner shall indemnify Design-Builder and Owner for all design-related claims in excess of insurance coverage.'),
  (111, 28, 'flow_down_provisions', 'Binding to Unknown Prime Contract Terms', 'HIGH', 'Trade Partner is bound by all Prime Contract terms without being provided a copy and waives right to claim additional compensation for unknown provisions', 'Demand to review the Prime Contract before signing and negotiate specific exclusions from flow-down provisions', 'open', NULL, NULL, NULL, '2026-01-19T01:30:45.895Z', '2026-01-19T01:30:45.895Z', 2, NULL, NULL, 'Trade Partner acknowledges that it has not been provided a copy of the Prime Contract and agrees to be bound by its terms regardless. Trade Partner waives any right to claim additional compensation based on Prime Contract provisions of which it was unaware at the time of executing this Subcontract.'),
  (112, 28, 'change_orders', 'No Change Orders for GMP Overruns', 'HIGH', 'Contract prohibits any Change Orders for costs that would exceed the GMP, placing all risk on Trade Partner', 'Negotiate allowance for Change Orders due to Owner-directed changes or unforeseen conditions', 'open', NULL, NULL, NULL, '2026-01-19T01:30:45.896Z', '2026-01-19T01:30:45.896Z', 3, NULL, NULL, 'There shall be no Change Orders for any costs that would exceed the GMP.'),
  (113, 28, 'consequential_damages', 'Unlimited Liability for Life Safety Systems', 'HIGH', 'Trade Partner has unlimited liability for damages resulting from life safety system failures', 'Negotiate cap on liability for life safety system failures and exclude damages beyond Trade Partner''s control', 'open', NULL, NULL, NULL, '2026-01-19T01:30:45.897Z', '2026-01-19T01:30:45.897Z', 3, NULL, NULL, 'Any failure of life safety systems attributable to Trade Partner''s work shall result in unlimited liability for resulting damages.'),
  (114, 28, 'warranty', 'Three-Year Performance Guarantee', 'HIGH', 'Trade Partner must guarantee all mechanical systems performance for three years with specific performance criteria and liquidated damages', 'Negotiate shorter warranty period and more realistic performance criteria', 'open', NULL, NULL, NULL, '2026-01-19T01:30:45.898Z', '2026-01-19T01:30:45.898Z', 3, NULL, NULL, 'Trade Partner guarantees that all mechanical systems shall achieve the following performance criteria for a period of three (3) years following substantial completion'),
  (115, 28, 'termination', 'Termination for Convenience with Seven Days Notice', 'HIGH', 'Design-Builder can terminate for convenience with only seven days notice, and Trade Partner has no claim for lost profits or overhead', 'Negotiate longer notice period and compensation for mobilization costs and reasonable overhead', 'open', NULL, NULL, NULL, '2026-01-19T01:30:45.899Z', '2026-01-19T01:30:45.899Z', 4, NULL, NULL, 'Design-Builder may terminate this Subcontract at any time for its convenience upon seven (7) days written notice. In such event, Trade Partner shall be paid for work completed, less retainage, and shall have no claim for lost profits, overhead, or other damages.'),
  (116, 28, 'insurance', 'Excessive Professional Liability Insurance Requirements', 'MODERATE', 'Contract requires Professional Liability Insurance of $5M per claim and $10M aggregate maintained for 10 years after completion', 'Negotiate reduced coverage limits and shorter tail coverage period', 'open', NULL, NULL, NULL, '2026-01-19T01:30:45.900Z', '2026-01-19T01:30:45.900Z', 3, NULL, NULL, 'Trade Partner shall maintain Professional Liability Insurance with limits of not less than $5,000,000 per claim and $10,000,000 aggregate, with a retroactive date prior to commencement of design services and maintained for ten (10) years following substantial completion.'),
  (117, 28, 'schedule_delays', 'Coordination Liability Regardless of Fault', 'HIGH', 'Trade Partner is solely responsible for all coordination conflicts regardless of which trade caused the conflict and must modify work at no additional cost', 'Negotiate shared responsibility for coordination conflicts and compensation for modifications due to other trades'' errors', 'open', NULL, NULL, NULL, '2026-01-19T01:30:45.901Z', '2026-01-19T01:30:45.901Z', 1, NULL, NULL, 'Trade Partner shall coordinate with all other trades and is solely responsible for all coordination conflicts, regardless of which trade caused the conflict. Trade Partner shall modify its work to resolve any conflicts at no additional cost.')
